import React from 'react';
import { Link } from 'react-router-dom';
import './Card.css';
import more from './more.png';

const Card = ({ post }) => {
  if (!post) {
    // Handle case where post is undefined or null
    return null;
  }

  const { id, title, upvotes, created_at } = post;

  return (
    <div className="Card">
      <Link to={`/post/${id}`}>
        <img className="moreButton" alt="edit button" src={more} />
      </Link>
      <p className="created_at">Created at: {created_at}</p>
      <h1 className="title">{title}</h1>
      <p className="upvotes">Upvotes: {upvotes}</p>
    </div>
  );
};

export default Card;
